import React from 'react';
// import link
import { Link } from 'react-router-dom';

// import components
import Header from '../Header-Footer/Header';
import Footer from '../Header-Footer/Footer'

// import images
import picture from '../../assets/images/meditate.svg';

const MentalCheckIn = () => {
  return (
    <>
    <Header />
    <div className="w-full py-20">
          <div className="md:max-w-[1080] m-auto grid md:grid-cols-2">
            {/* text */}
                <div data-aos="fade-left" data-aos-duration="1500" className="flex flex-col justify-start gap-4 py-24">
                  <h1 className='py-2 md:text-5xl text-4xl font-[700] text-greenColor'>Mental Health <br />Check-In</h1>
                  <p className='py-2 text-lg text-gray-600'>You may feel healthy one day and a bit unsettled the next. Sometimes you start healing in a few days and other times you struggle. You may even feel in crisis.</p>
                  
                  <Link to='/activities'>
                      <button className='flex items-center mt-8 px-6 p-2 gap-2 shadow-lg shadow-black rounded-lg text-md font-[600] bg-brightColor hover:bg-softColor transition'><i class="ri-play-line" />Start</button>
                  </Link>
                </div>

                <img className='floating md:order-last order-first' src={picture} />

          </div>
    </div>

    <div className='text-center max-w-[1920]'>
            <p className='text-medium text-bold text-[#EB801D] font-semibold text-base'>Support</p>
            <h1 className='font-bold text-3xl'>Subscribe Newsletter & get</h1>
            <h2 className='font-light text-2xl'>Updates</h2>
            <form className=''>
            <input className='font-[400] border p-3 py-2 w-80 rounded-lg bg-transparent text-sm hover:bg-insideColor' type="email" placeholder='Your Email' required/>
            <button className='w-40 h-10 bg-[#FFCA1D] rounded-lg border'>Subscribe</button>

            </form>
        </div>
    <Footer />

    </>
  )
}

export default MentalCheckIn
